import React from 'react'



  let color = '#'
  let str = '0123456789abcdef'
  for (let i = 0; i < 6; i++) {
    let index = Math.floor(Math.random() * str.length)
    color += str[index]
  }

let style = {
  textAlign : 'center',
  width : '100%'
}

function RandomColor() {
  return (
    <div style={ style}>
      <h2 style={{backgroundColor : {color} , color : 'black'}}>{color}</h2>
    </div>
  )
}

export default RandomColor
